import React, {Component} from 'react';
import { Link } from 'react-router-dom';
import './LoginPage.css';

class LoginPage extends Component {
  render() {
    var root = document.getElementById('root');
    root.className = '';
    root.classList.add('loginPage');

    return (
        <div className="login-page">
          <form>
            <input type="text" id="loginEmail" placeholder="E-mail"></input>
            <input type="password" id="loginPassword" placeholder="Password"></input>
            <button id="loginButton" className="app-navigation-button border-04">Login</button>
            <button className="app-navigation-button border-04" data-pagename="registerPage"><Link to="/register">Register</Link></button>
          </form>
        </div>
    );
  }
}

export default LoginPage;
